import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './UserProfile.css';

const UserProfile = () => {
    const navigate = useNavigate();
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [userPreferences, setUserPreferences] = useState(null);
    const [userStats, setUserStats] = useState({
        totalSessions: 0,
        averageAccuracy: 0,
        favoriteYogaPose: '',
        lastPractice: ''
    });

    useEffect(() => {
        const fetchUserData = async () => {
            try {
                const token = localStorage.getItem('userToken');
                if (!token) {
                    navigate('/login');
                    return;
                }

                const response = await fetch('/api/users/profile', {
                    headers: {
                        'x-auth-token': token
                    }
                });

                if (!response.ok) {
                    const data = await response.json();
                    throw new Error(data.message || 'Failed to fetch user data');
                }

                const data = await response.json();
                setUserPreferences(data.preferences);
                setUserStats(data.stats);

                // Update localStorage with latest preferences
                localStorage.setItem('userPreferences', JSON.stringify(data.preferences));
            } catch (err) {
                setError(err.message || 'Failed to fetch user data');
            } finally {
                setLoading(false);
            }
        };

        fetchUserData();
    }, [navigate]);

    if (loading) {
        return <div className="loading">Loading...</div>;
    }

    if (error) {
        return <div className="error">{error}</div>;
    }

    if (!userPreferences) {
        return <div>No user preferences found</div>;
    }

    return (
        <div className="user-profile">
            <div className="profile-header">
                <h1>User Profile</h1>
                <p>Welcome back, {userPreferences.name || 'Yogi'}!</p>
            </div>

            <div className="stats-grid">
                <div className="stat-card">
                    <i className="fas fa-clock"></i>
                    <h3>Total Sessions</h3>
                    <p>{userStats.totalSessions}</p>
                </div>
                <div className="stat-card">
                    <i className="fas fa-bullseye"></i>
                    <h3>Average Accuracy</h3>
                    <p>{Math.round(userStats.averageAccuracy)}%</p>
                </div>
                <div className="stat-card">
                    <i className="fas fa-star"></i>
                    <h3>Favorite Pose</h3>
                    <p>{userStats.favoriteYogaPose || 'Not yet determined'}</p>
                </div>
                <div className="stat-card">
                    <i className="fas fa-calendar"></i>
                    <h3>Last Practice</h3>
                    <p>{userStats.lastPractice ? new Date(userStats.lastPractice).toLocaleDateString() : 'No practice yet'}</p>
                </div>
            </div>

            <div className="preferences-section">
                <h2>Your Preferences</h2>
                <div className="preferences-grid">
                    <div className="preference-item">
                        <label>Experience Level</label>
                        <p>{userPreferences.experienceLevel}</p>
                    </div>
                    <div className="preference-item">
                        <label>Practice Duration</label>
                        <p>{userPreferences.practiceDuration} minutes</p>
                    </div>
                    <div className="preference-item">
                        <label>Practice Frequency</label>
                        <p>{userPreferences.practiceFrequency}</p>
                    </div>
                    <div className="preference-item">
                        <label>Focus Areas</label>
                        <p>{userPreferences.focusAreas?.join(', ') || 'None selected'}</p>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default UserProfile;
